import React, { Component } from 'react'
import SecondComponent from './SecondComponent'



export default class VallueAssing extends Component {
    constructor(props){
        super(props)
        this.state = {
            name:"Ankit",
            age:24,
            proffecion:"Devloper",
            hobbie:"Coding",
        }
    }

    render() {
        return (
            <div class="vallu">
                <h1>person Detail's</h1>
                <p>{this.state.name}</p>
                <SecondComponent age = {this.state.age}  hobbie = {this.state.hobbie}/>
            </div>
        )
    }
}
